    value: 'Hayes for Congress goes to great lengths to provide accurate and complete
      data as required by the Federal Election Commission (FEC).      First, all solicitations
      made by Hayes for Congress have the FEC required disclaimer stated that contributors
      must provide their occupation and employer information. Second, if a contribution
      is received lacking the required information, Hayes for Congress sends a letter
      to the contributor whose record is incomplete.  Hayes for Congress generally
      sends a batch of letters every Friday to these contributors.       Contents
      of the letter:   Dear contributor:    Thank you for your generous contribution
      to our Hayes for Congress.  This is a critical time in our campaign and your
      support is very much needed and appreciated.      In order to comply with Federal
      Election Commission (FEC) reporting requirements, our campaign is required to
      report your occupation and employer information on our next FEC report.  Please
      fill out the form at the bottom of this letter and either return by the enclosed
      business return envelope or fax to 704/795-1997.     Again, thank you for your
      support.  We look forward to hearing from you soon.    Sincerely,  Hayes for
      Congress    Name: _____________________________________  Occupation: _________________________________  Employer:
      _______________________________    Third, if Hayes for Congress does not receive
      a response from the contributor, Hayes for Congress personnel attempts to call
      the contributor to ascertain the missing information over the phone.        The
      October quarterly report (7/1/2008-9/30/2008) report had close to 2,000 itemized
      contributions from individuals.  Hayes for Congress did the best it could to
      collect accurate data during the third quarter, however do to the volume of
      contributions under $200 whose individual aggregate total for the election cycle
      exceeded $200, Hayes for Congress had to process much of this data after the
      reporting deadline.  Hayes for Congress is still in the process of collecting
      data, but has made every effort to collect the data requested.'
